  // modify this\n  ChiliPiper.submit("mapbox", "life-in-the-fast-lane", chili_options);\n};\n\n// Setup MadKudu FastLane modal\nvar showModal = function() {\n  var traits = madkudu.user().traits();\n  var firstName = traits.first_name;\n\n  if (!firstName) {\n    firstName = "Howdy";\n  }\n\n  var modalOptions = {\n    title: firstName + ", you qualify for the fast lane!",\n    subtitle:\n      "Our scoring tells us you should get access to an Expert\'s calendar now.",\n    cta_yes: "Book a time now",\n    cta_no: "No thanks."\n  };\n\n  form.show_modal(modalOptions);\n  //Add Tracking\n  analytics.track("Fast Lane Modal Shown");\n\n  // listen to the modal\n  var add_listeners = function() {\n    // listen on the cancel button to trigger the hiding of the MadKudu modal\n    $(".madkudu_modal__cancel").on("click", function() {\n      analytics.track("Fast Lane Modal Dismissed");\n    });\n    // listen on accept button to trigger the showing of the Chili Piper widget\n    $(".madkudu_modal__accept").on("click", function() {\n      send_to_chili_piper();\n      analytics.track("Fast Lane Modal Clicked");\n    });\n  };\n  add_listeners();\n};\n\n// Assign a listener to the form to show the Fast Lane Modal\n// if the lead is qualified\n$(\'#\' + FORM_ID).on(\'submit\', function () {\n  if (!CONTACT_PAGE_REGEX.test(window.location.href)) {\n    return;\n  }\n\n  if (madkudu.user().is_qualified()) {\n    window.setTimeout(function () {\n      showModal();\n    }, 300); // allow a delay for the page to update after success\n  }\n});\n\n// =============================\n// Set custom styling of modal\n// =============================\n\nvar styles = [\n  \'button.madkudu_modal__button--primary {\',\n\t\'  text-align: center;\',\n  \'}\'\n].join(\'\\n\');\nvar load_style = function(styles) {\n  // see here for explanations: http://jonraasch.com/blog/javascript-style-node\n  var css = document.createElement("style");\n  css.type = "text/css";\n  if (css.styleSheet) {\n    